import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <h1>Belajar Router</h1>

      <Home />
      <About />
      <Users />
    </div>
  );
}

const Home = () => (
  <div>
    <h1>Home</h1>
  </div>
)

const About = () => (
  <div>
    <h1>About</h1>
  </div>
)

const Users = () => (
    <div>
        <h1>Users</h1>
    </div>
);

export default App;
